mapper.select:
    select sum(0

		 + PAYPRINCIPALAMT


		 + PAYINTEAMT


		+A2


		+A7


		+A12


		+A18


		+A9


		+A10


		+A17


		+A19

	) as totalfee,duedate from cw_voucher_fact_result CW where 1=1

		AND CW.BUSINESSMODEL=#{factAccountVo.businessmodel,jdbcType=VARCHAR}



		AND CW.CANCELTYPE is null


		AND CW.CANCELTYPE=#{factAccountVo.canceltype,jdbcType=VARCHAR}



		AND CW.ASSETBELONG = #{factAccountVo.assetbelong,jdbcType=VARCHAR}


		AND CW.GUARANTEEPARTY = #{factAccountVo.guaranteeparty,jdbcType=VARCHAR}


		AND CW.SPONSOR = #{factAccountVo.sponsor,jdbcType=VARCHAR}



		AND CW.SPONSORTYPE is null


		AND CW.SPONSORTYPE = #{factAccountVo.sponsortype,jdbcType=VARCHAR}



		AND CW.IS_INSTALMENTS_END = #{factAccountVo.isinstalmentsend,jdbcType=VARCHAR}



		AND CW.BXHXDATE is null


		AND CW.BXHXDATE is not null



		AND CW.CITY = #{city,jdbcType=VARCHAR}

		group by duedate
